import React, { useRef, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import TransformationInterface from './components/TransformationInterface';
import './App.css';

// Add sample images with the correct paths
const beforeAfterImages = {
  backgroundMagic: {
    before: '/images/beach-before.jpg',
    after: '/images/beach-after.jpg'
  },
  fantasyCharacters: {
    before: '/images/character-before.jpg',
    after: '/images/character-after.jpg'
  },
  threeDPrinting: {
    before: '/images/3d-before.jpg',
    after: '/images/3d-after.jpg'
  }
};

interface BeforeAfterSliderProps {
  beforeImage: string;
  afterImage: string;
}

function BeforeAfterSlider({ beforeImage, afterImage }: BeforeAfterSliderProps) {
  const sliderRef = useRef<HTMLDivElement>(null);
  const containerRef = useRef<HTMLDivElement>(null);
  const isDragging = useRef(false);

  useEffect(() => {
    const slider = sliderRef.current;
    const container = containerRef.current;

    if (!slider || !container) return;

    const updateSliderPosition = (clientX: number) => {
      const rect = container.getBoundingClientRect();
      const x = Math.min(Math.max(clientX - rect.left, 0), rect.width);
      const percent = (x / rect.width) * 100;
      slider.style.left = `${percent}%`;
      const beforeImage = container.querySelector('.before-image') as HTMLElement;
      if (beforeImage) {
        beforeImage.style.clipPath = `polygon(0 0, ${percent}% 0, ${percent}% 100%, 0 100%)`;
      }
    };

    const handleMouseDown = (e: MouseEvent) => {
      isDragging.current = true;
      updateSliderPosition(e.clientX);
    };

    const handleMouseMove = (e: MouseEvent) => {
      if (!isDragging.current) return;
      updateSliderPosition(e.clientX);
    };

    const handleMouseUp = () => {
      isDragging.current = false;
    };

    const handleTouchStart = (e: TouchEvent) => {
      isDragging.current = true;
      updateSliderPosition(e.touches[0].clientX);
    };

    const handleTouchMove = (e: TouchEvent) => {
      if (!isDragging.current) return;
      updateSliderPosition(e.touches[0].clientX);
    };

    const handleTouchEnd = () => {
      isDragging.current = false;
    };

    // Mouse events
    slider.addEventListener('mousedown', handleMouseDown);
    window.addEventListener('mousemove', handleMouseMove);
    window.addEventListener('mouseup', handleMouseUp);

    // Touch events
    slider.addEventListener('touchstart', handleTouchStart);
    window.addEventListener('touchmove', handleTouchMove);
    window.addEventListener('touchend', handleTouchEnd);

    // Initial position
    updateSliderPosition(container.getBoundingClientRect().left + container.getBoundingClientRect().width / 2);

    return () => {
      // Cleanup mouse events
      slider.removeEventListener('mousedown', handleMouseDown);
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('mouseup', handleMouseUp);

      // Cleanup touch events
      slider.removeEventListener('touchstart', handleTouchStart);
      window.removeEventListener('touchmove', handleTouchMove);
      window.removeEventListener('touchend', handleTouchEnd);
    };
  }, []);

  return (
    <div ref={containerRef} className="before-after-container">
      <div className="before-image">
        <img src={beforeImage} alt="Before" />
      </div>
      <div className="after-image">
        <img src={afterImage} alt="After" />
      </div>
      <div ref={sliderRef} className="slider-handle"></div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gradient-to-br from-gray-900 via-purple-900 to-violet-800 text-white">
        {/* Navigation */}
        <nav className="fixed top-0 left-0 right-0 bg-black bg-opacity-20 backdrop-blur-lg z-50">
          <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
            <div className="flex items-center justify-between h-16">
              <div className="flex items-center">
                <Link to="/" className="text-xl font-bold bg-gradient-to-r from-blue-400 to-emerald-400 text-transparent bg-clip-text">
                  AI Photo Magic
                </Link>
              </div>
              <div className="flex space-x-4">
                <Link to="/" className="text-gray-300 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Home
                </Link>
                <Link to="/transform" className="text-gray-300 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Transform
                </Link>
                <Link to="/gallery" className="text-gray-300 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Gallery
                </Link>
                <Link to="/contact" className="text-gray-300 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Contact
                </Link>
              </div>
            </div>
          </div>
        </nav>

        {/* Main Content */}
        <div className="pt-16">
          <Routes>
            <Route path="/transform" element={<TransformationInterface />} />
            <Route path="/" element={
              <div>
                {/* Hero Section */}
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
                  <div className="text-center">
                    <h1 className="text-4xl tracking-tight font-extrabold sm:text-5xl md:text-6xl">
                      <span className="block">Transform Your Photos into</span>
                      <span className="block bg-gradient-to-r from-teal-200 to-cyan-400 text-transparent bg-clip-text">
                        Magical Moments & 3D Reality
                      </span>
                    </h1>
                    <p className="mt-3 max-w-md mx-auto text-base text-gray-300 sm:text-lg md:mt-5 md:text-xl md:max-w-3xl">
                      Transform your photos into fantasy characters, change backgrounds instantly, or create stunning 3D-printed figures. Experience the magic of AI-powered transformations.
                    </p>
                    <div className="mt-5 max-w-md mx-auto sm:flex sm:justify-center md:mt-8">
                      <div className="rounded-md shadow">
                        <Link
                          to="/transform"
                          className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-white bg-gradient-to-r from-teal-500 to-cyan-600 hover:from-teal-600 hover:to-cyan-700 md:py-4 md:text-lg md:px-10"
                        >
                          Start Creating Magic
                        </Link>
                      </div>
                      <div className="mt-3 rounded-md shadow sm:mt-0 sm:ml-3">
                        <Link
                          to="/gallery"
                          className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-cyan-600 bg-white hover:bg-gray-50 md:py-4 md:text-lg md:px-10"
                        >
                          View Gallery
                        </Link>
                      </div>
                    </div>
                  </div>
                </div>

                {/* Features Section */}
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
                  <h2 className="text-3xl font-extrabold text-center mb-12">
                    Transform Your Photos & Create 3D Memories
                  </h2>
                  <div className="features-grid">
                    <div className="feature-card special-card">
                      <div className="feature-image">
